// Molecular Dynamics (written by Hiroshi Tsutsui, Japan)

void Bessel(double** hts)
{
  static double deltar = 0.05e0;
  static double deltas = 0.05e0;
  static double deltarinv = 20.0;
  static double deltasinv = 20.0;
  double sn = 1.0;
  double s2 = *hts[1];
  long nr, ns;
  double dr, dr2, ds, ds2, ans;
  if(*hts[1] < 0){
    s2 = - *hts[1];
    sn = -1.0;
  }
  if(*hts[0] >= 49.5){
     *hts[3] =  0.0;
     *hts[2] = -1.0 / *hts[0];
     return;
  }
  nr = (long)(*hts[0] * deltarinv);
  ns = (long)(s2 * deltasinv);

  dr = *hts[0] - nr * deltar;
  dr2 = deltar - dr;
  ds = s2 - ns * deltas;
  ds2 = deltas - ds;
  ans = (dpotds[nr][ns] * dr2 + dpotds[nr + 1][ns] * dr) * ds2
              + (dpotds[nr][ns + 1] * dr2 + dpotds[nr + 1][ns + 1] * dr) * ds;
  *hts[3] = sn * ans * (deltarinv * deltasinv) / *hts[4];
  ans = (dpotdr[nr][ns] * dr2 + dpotdr[nr + 1][ns] * dr) * ds2
              + (dpotdr[nr][ns + 1] * dr2 + dpotdr[nr + 1][ns + 1] * dr) * ds;
  *hts[2] = ans * (deltarinv * deltasinv);
}

void Bessel(double r, double s, double &dudr, double &duds)
{
  static double deltar = 0.05e0;
  static double deltas = 0.05e0;
  static double deltarinv = 20.0;
  static double deltasinv = 20.0;
  double sn = 1.0;
  double s2 = s;
  if(s < 0){
    s2 = -s;
    sn = -1.0;
  }
  if(r >= 49.5){
    duds =  0.0;
    dudr = -1.0 / r;
    return;
  }
  long nr = (long)(r * deltarinv);
  long ns = (long)(s2 * deltasinv);

  double dr = r - nr * deltar;
  double dr2 = deltar - dr;
  double ds = s2 - ns * deltas;
  double ds2 = deltas - ds;
  double ans = (dpotds[nr][ns] * dr2 + dpotds[nr + 1][ns] * dr) * ds2
              + (dpotds[nr][ns + 1] * dr2 + dpotds[nr + 1][ns + 1] * dr) * ds;
  duds = sn * ans * (deltarinv * deltasinv);
  ans = (dpotdr[nr][ns] * dr2 + dpotdr[nr + 1][ns] * dr) * ds2
              + (dpotdr[nr][ns + 1] * dr2 + dpotdr[nr + 1][ns + 1] * dr) * ds;
  dudr = ans * (deltarinv * deltasinv);
}


